import './App.css';



function currentDate(date){
  return date.toLocaleDateString();
}

function Comment(props){
  return(
    <div>
      <div className="Comment">{props.text}</div>
      <div className="Comment-date">{currentDate(props.date)}</div>
    </div>
  );
}

const comment = {
  text: 'Hello React!',
  date: new Date()
};

function App() {
  return (
    <Comment
      text={comment.text}
      date={comment.date}
    />
  )
}

export default App;
